import React from "react";
import { Link, useNavigate } from "react-router-dom";
import Footer from "../../components/Footer";
import Header from "../../components/Header";
import { useAuth } from "../../context/authContext";
import { useState } from "react";

const Login = () => {
  const [user, setUser] = useState({
    email: "",
    password: "",
  });
  const { login } = useAuth();
  const navigate = useNavigate();
  const [error, setError] = useState();

  const handleChange = ({ target: { name, value } }) => {
    setUser({ ...user, [name]: value });
  };
  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    try {
      await login(user.email, user.password);
      navigate("/");
    } catch (error) {
      if (error.code === "auth/wrong-password") {
        setError("Las credenciales no coinciden con nuestra base de datos");
      } else if (error.code === "auth/user-not-found") {
        setError("Usuario no encontrado");
      } else if (error.code === "auth/invalid-email") {
        setError("Las credenciales no coinciden con nuestra base de datos");
      }
    }
  };
  return (
    <div>
      <Header />
      <div
        className="hero min-h-screen"
        style={{
          backgroundImage: `url("https://cloudfront-us-east-1.images.arcpublishing.com/prisaradioco/ANHOGWBBKFO4NOHJ5ZJ2GJWGDA.jpg")`,
        }}
      >
        <div className="hero-overlay bg-opacity-60"></div>
        <div className="hero min-h-screen">
          <div className="hero-content flex-col lg:flex-row-reverse">
            <div className="text-center lg:text-left">
              <h1 className="text-5xl font-bold text-white">Ingresa ahora!</h1>
              <p className="py-6 text-2xl text-white">
                Con tus datos y con un simple click podras tener todo al alcance
                de tu mano.
              </p>
              <p className="py-1 text-2xl text-white">
                ¡En caso de todavia no tener tu cuenta registrate ahora!
              </p>
            </div>
            <div className="card flex-shrink-0 w-full max-w-sm shadow-2xl bg-white/60">
              <div className="card-body">
                <div className="form-control">
                  <input
                    type="email"
                    name="email"
                    placeholder="Correo electronico"
                    onChange={handleChange}
                    className="input input-bordered bg-white/80 text-black placeholder-black/50"
                  />
                </div>
                <div className="form-control">
                  <input
                    type="password"
                    name="password"
                    placeholder="Contraseña"
                    onChange={handleChange}
                    className="input input-bordered bg-white/80 text-black placeholder-black/50"
                  />

                  <Link to="/register" className=" mt-3 text-red-600 link">
                    No tienes cuenta? ¡Registrate!
                  </Link>
                </div>
                <Link to="/">
                  <div className="form-control mt-3">
                    {error && <p className="text-black pb-3">{error}</p>}
                    <button
                      className="btn btn-primary bg-red-600"
                      onClick={handleSubmit}
                    >
                      Ingresa con tu cuenta registrada
                    </button>
                    <button class="btn gap-2 mt-4 bg-red-600 text-white hover:bg-blue-500">
                      <svg
                        style="color: white"
                        xmlns="http://www.w3.org/2000/svg"
                        viewBox="0 0 24 24"
                      >
                        <defs>
                          <style></style>
                        </defs>
                        <title>google</title>
                        <g id="Layer_2" data-name="Layer 2">
                          <g id="google">
                            <g id="google-2" data-name="google">
                              <polyline
                                class="cls-1"
                                points="0 0 24 0 24 24 0 24"
                              ></polyline>
                              <path
                                class="cls-2"
                                d="M12,22h-.43A10.16,10.16,0,0,1,2,12.29,10,10,0,0,1,16.12,2.88a1.48,1.48,0,0,1,.77.86,1.47,1.47,0,0,1-.1,1.16L15.5,7.28a1.44,1.44,0,0,1-1.83.64A4.5,4.5,0,0,0,8.77,9a4.41,4.41,0,0,0-1.16,3.34,4.36,4.36,0,0,0,1.66,3,4.52,4.52,0,0,0,3.45,1,3.89,3.89,0,0,0,2.63-1.57h-2.9A1.45,1.45,0,0,1,11,13.33V10.65A1.45,1.45,0,0,1,12.45,9.2h8.1A1.46,1.46,0,0,1,22,10.64c0,.63,0,1.7,0,1.88A10,10,0,0,1,12,22ZM12,4a8,8,0,0,0-8,8.24A8.12,8.12,0,0,0,11.65,20,8,8,0,0,0,20,12.42V11.2H13v1.58h5.31l-.41,1.3A6,6,0,0,1,13,18.33,6.58,6.58,0,0,1,8,17a6.33,6.33,0,0,1-.72-9.3A6.52,6.52,0,0,1,14,5.91l.77-1.43A7.9,7.9,0,0,0,12,4Z"
                                fill="white"
                              ></path>
                            </g>
                          </g>
                        </g>
                      </svg>
                      Ingresa con Google
                    </button>
                  </div>
                </Link>
              </div>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Login;
